import React, { useEffect } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import { PageContainer, Title } from "./styles/solution_style.js";

function Solution() {
  const center = [39.1, -76.1];
  const zoom = 10;
  const windyUrl =
    "https://tiles.windy.com/tiles/v9.0/wind/{z}/{x}/{y}.png?key=fieU8xwZgvQ6b9LAHm9ws6BMV2jU73Qt";

  return (
    <MapContainer center={center} zoom={zoom}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a>'
      />
      <TileLayer
        url={windyUrl}
        maxZoom={18}
        attribution='Map data &copy; <a href="https://www.windy.com">Windy.com</a>'
      />
    </MapContainer>
  );
}

export default Solution;

